// HomePage.js

import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div>
      {/* Header */}
      <header style={styles.header}>
        <h1 style={styles.logo}>Auction Platform</h1>
        <div style={styles.userContainer}>
          <img src="/path/to/your/user-icon.png" alt="User Icon" style={styles.userIcon} />
          <div style={styles.userOptions}>
            <span style={styles.userOption}>Logout</span>
            <span style={styles.userOption}>Settings</span>
          </div>
        </div>
        <nav style={styles.nav}>
          <a href="#home" style={styles.navLink}>Home</a>
          <a href="#categories" style={styles.navLink}>Contact Us</a>
          <a href="#sell" style={styles.navLink}>Sell</a>
          <a href="#login" style={styles.navLink}>Login</a>
        </nav>
      </header>

      {/* Banner */}
      <section style={styles.banner}>
        <h2 style={styles.bannerText}>Welcome to Auction Platform - Your Destination for Exciting Bidding!</h2>
      </section>

      {/* Product Listing */}
      <section style={styles.productListing}>
        {/* Product Cards */}
        {/* ... (Your existing product cards) */}
      </section>

      {/* Footer */}
      <footer style={styles.footer}>
        <p style={styles.footerText}>Auction Hub &copy; 2024</p>
        <p style={styles.footerText}><strong>Kaliraj M & Sridhar R</strong></p>
      </footer>
    </div>
  );
};

const styles = {
  header: {
    backgroundColor: '#1a237e',
    padding: '15px',
    color: '#fff',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    position: 'sticky',
    top: 0,
    zIndex: 1000, // Ensure the header is above other elements
  },
  logo: {
    margin: 0,
    fontSize: '24px',
  },
  userContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  userIcon: {
    width: '30px',
    height: '30px',
    borderRadius: '50%',
    marginRight: '10px',
  },
  userOptions: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-end',
  },
  userOption: {
    marginBottom: '5px',
    cursor: 'pointer',
    color: '#ffffff',
    textDecoration: 'underline',
  },
  nav: {
    display: 'flex',
  },
  navLink: {
    color: '#fff',
    margin: '0 15px',
    textDecoration: 'none',
    fontSize: '16px',
  },
  productListing: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    padding: '20px',
  },
  productCard: {
    border: '1px solid #ccc',
    borderRadius: '8px',
    margin: '10px',
    padding: '15px',
    maxWidth: '300px',
    boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
    transition: 'transform 0.3s ease-in-out',
    backgroundColor: '#fff',
    overflow: 'hidden',
  },
  productImage: {
    width: '100%',
    height: 'auto',
    borderRadius: '8px',
  },
  productTitle: {
    marginTop: '10px',
    marginBottom: '5px',
    fontSize: '18px',
  },
  productDescription: {
    color: '#555',
    fontSize: '14px',
  },
  bidButton: {
    backgroundColor: '#1a237e',
    color: '#fff',
    padding: '8px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '10px',
    fontSize: '14px',
    transition: 'background-color 0.3s ease-in-out',
  },
  bidButtonHover: {
    backgroundColor: '#3949ab',
  },
  footer: {
    backgroundColor: '#1a237e',
    color: '#fff',
    textAlign: 'center',
    padding: '10px',
    position: 'fixed',
    bottom: 0,
    width: '100%',
  },
  footerText: {
    margin: 0,
    fontSize: '14px',
  },
  banner: {
    backgroundColor: '#4285f4', // Choose a nice color for your banner
    textAlign: 'center',
    color: '#fff',
    padding: '50px 0', // Adjust the padding as needed
  },
  bannerText: {
    fontSize: '24px',
    margin: 0,
  },
};

export default HomePage;
